pragma solidity ^0.4.4;

contract FuturePrice {

  uint256 public ethusd;
  uint256 public basispoint;
  uint256 public year;         //want to have quarters but not sure how because of decimals
  uint256 public futpricedollars;
  uint256 public futpricecents;

  function FuturePrice(uint256 ethusdc, uint256 bp, uint256 y) public {
    // constructor
    ethusd = ethusdc;
    basispoint = bp;
    year = y;
    uint256 exponentvalue = (10000+basispoint)**year;
    uint256 i = 100*(10000)**year;
    futpricedollars = ethusd*exponentvalue/i; 
    futpricecents = ethusd*exponentvalue%i; 
  }
  // futures dollar and cent value 
  function output() public constant returns(uint256 , uint256) {
    return (futpricedollars,futpricecents);
  }  
}
